function Header() {
  return (
    <React.Fragment>
      <nav class="navbar navbar-expand-lg fixed-top">
        <div class="container-fluid row">
          <div class="col-3">
            <a class="navbar-brand" href="#">
              Navbar
            </a>
          </div>
          <div
            class="col-9 collapse navbar-collapse"
            id="navbarSupportedContent"
          >
            <div class="col-6">
              <ul class="navbar-nav me-auto mb-2 mb-lg-0">
                <li class="nav-item dropdown mx-3">
                  <a
                    class="nav-link dropdown-toggle"
                    href="#"
                    role="button"
                    data-bs-toggle="dropdown"
                  >
                    服務項目
                  </a>
                  <ul class="dropdown-menu">
                    <li>
                      <a class="dropdown-item" href="#">
                        代遛服務
                      </a>
                    </li>
                    <li>
                      <a class="dropdown-item" href="#">
                        寵物保母
                      </a>
                    </li>
                    <li>
                      <a class="dropdown-item" href="#">
                        毛孩領養
                      </a>
                    </li>
                  </ul>
                </li>

                <li class="nav-item mx-3">
                  <a class="nav-link active" href="#">
                    商品一覽
                  </a>
                </li>
                <li class="nav-item mx-3">
                  <a class="nav-link" href="#">
                    FQA
                  </a>
                </li>
              </ul>
            </div>
            <div class="container-fluid d-flex flex-nowrap col-6 align-items-center">
              <div class="mx-4">
                <form class="d-flex" role="search">
                  <input
                    class="form-control me-2"
                    type="search"
                    placeholder="Search"
                  />
                  <a href="" type="submit">
                    <img src="../img/search.svg" style={{ height: "45px" }} />
                  </a>
                </form>
              </div>

              <div class="mx-4 text-center">
                <li class="nav-item">
                  <a href="#">
                    <img
                      src="../img/membercat.png"
                      style={{ height: "55px" }}
                    />
                  </a>
                </li>
              </div>

              <div class="mx-4 text-center">
                <li class="nav-item">
                  <a href="#">
                    <img src="../img/cart.png" style={{ height: "50px" }} />
                  </a>
                </li>
              </div>
            </div>
          </div>
        </div>
      </nav>
    </React.Fragment>
  );
}

export default Header;
